import React from 'react';
import NavItem from './NavItem';
import {MdPeopleOutline,MdChatBubbleOutline} from 'react-icons/md';
import {GrChatOption,GrLocation,GrGroup,GrMailOption,GrBriefcase} from 'react-icons/gr';
import styles from './NavList.module.css';

export default function NavList() {
    return (
        <div className={styles.nav_list}>
            <NavItem> <MdPeopleOutline/> </NavItem>
            <NavItem> <MdChatBubbleOutline/> </NavItem>
            <NavItem> <GrLocation/> </NavItem>
            <NavItem> <GrGroup/> </NavItem>
            <NavItem> <GrMailOption/> </NavItem>
            <NavItem> <GrBriefcase/> </NavItem>
        </div>
    )
}
